import React from 'react';
import Card from './UI/Card';

function Login(props)	{
	return (
		<Card>
			<form>
				<input type="email"/>
				<input type="password"/>
				<button type="submit">Login</button>
			</form>
		</Card>
	)
}

export default Login;
